import React from "react";
import "./App.css";
import Navbar from "./components/Navbar";
import AboutMe from "./components/AboutMe";
import Projects from "./components/Projects";
import Skills from "./components/Skills";
import Contact from "./components/Contact";

function App() {
  return (
    <div className="App">
      <Navbar />
      <main style={{ maxWidth: "800px", margin: "2rem auto", padding: "1rem" }}>
        <section id="about"><AboutMe /></section>
        <section id="projects"><Projects /></section>
<section id="skills"><Skills /></section>
<section id="companies" style={{ marginBottom: "2.5rem", textAlign: "left" }}>
  <h2>Companies I've Worked With</h2>
  <ul style={{ listStyleType: "none", padding: 0 }}>
    <li>
          <div className="projects-list-row">
            <span className="project-title"><strong>Globant (Current)</strong></span>
          </div>
        </li>
    <li><strong>Globant</strong> </li>
    <li>LTIMindtree</li>
    <li>Anveshak Technologies</li>
    <li>Mobile sutra</li>
  </ul>
</section>
<section id="contact"><Contact /></section>
      </main>
    </div>
  );
}

export default App;
